INSERT INTO `project` VALUES (25,2050,'Test','Test ','Test','Test','Test','Test','Test',NULL,NULL,'2016-01-21 19:08:58','2016-01-21 19:08:58'),(26,2051,'Test','Test ','Test','Test','Test','Test','Test',NULL,NULL,'2016-01-22 11:05:10','2016-01-22 11:05:10'),(27,2052,'Test','Test ','Test','Test','Test','Test','Test',NULL,NULL,'2016-01-22 11:05:46','2016-01-22 11:05:46'),(29,2054,'WM Acorn','Waste Management ','1 year','WM partner with their customers and communities to manage and reduce waste from collection to disposal while recovering valuable resources and creating clean, renewable energy.\r\nThis is a broker application between customers and vendors.\r\nIt provides a wide range of waste and recycling services to help you remove materials that don','Developer','Understanding requirements, prepared unit test cases, Coding and unit','MVC',NULL,NULL,'2016-01-22 11:41:38','2016-01-22 11:41:38'),(30,2054,'Telguard','Telular Telguard ','8 months','Telguard is a dealer exclusively focused on giving independent security dealers the necessary tools \r\nto break their dependence on landlines for a profitable business. Benefiting from its simple installation, reliable operation, and over 25 years of wireless experience, it has grown to be one of America?s largest security communications solutions.\r\nThis project has been initiated as per the client?s requirements.\r\n Detailed reports and formats have been collected and implemented accordingly.','Developer','Understanding requirements, prepared unit test cases, Coding and unit','MVC',NULL,NULL,'2016-01-22 11:41:38','2016-01-22 11:41:38'),(31,2054,'FirstLook','Firstlook ','-','FirstLook Systems provides Retail Performance Management software for used car dealers.\r\n\r\nThe software supports Appraisals, Inventory Management, Stocking Recommendations and analytics to optimize retail performance.\r\n\r\n It offers innovative Software as a Service (SaaS) based inventory management systems that are \r\n\r\ntransforming the automotive industries. It also integrates with a number of books (data providers ) like KBB, BlackBook & others that helps buyers and sellers establish a common ground during the car buying \r\n\r\n It also supports the inventory and sales data from other dealer Management Systems (DMS) like Reynolds \r\n\r\n& Reynolds, SiS and ADP to their systems.','Developer','Understanding requirements, different layers, prepared unit test cases, Coding and unit testing.','MVC, 3 TIER architecture',NULL,NULL,'2016-01-22 11:41:38','2016-01-22 11:41:38'),(32,2055,'Test','Test ','Test','Test','Test','Test','Test',NULL,NULL,'2016-01-22 11:51:05','2016-01-22 11:51:05'),(34,2056,'Q-Parking','Quinnox ','1','Parking management system designed such that an employee has a reserved slot in parking based on his/her time of entry. ','Dev','Project planning, DB connectivity','Eclipse',NULL,NULL,'2016-01-22 12:48:00','2016-01-22 12:48:00'),(35,2057,'Q-Parking','Quinnox  ','1month','Parking management system for Quinnox. It allocates a parking slot for the employee based on the time of his/her entry. It also gives the amount of Parking slots which are occupied and those which are free.','Dev','Project planning, DB connectivity','Java',NULL,NULL,'2016-01-22 13:14:15','2016-01-22 13:14:15'),(36,2060,' Ebiz',' Waste Management(U.S.A)',' Feb 2015 -till present','Waste Management, Inc. is the leading provider of comprehensive waste and environmental services in North America. Headquartered in Houston, the company serves nearly 20 million municipal, commercial, industrial, and residential customers through a network of 367 collection operations, 355 transfer stations, 273 active landfill disposal sites, 16 waste-to-energy plants, 104 recycling plants, and 111 beneficial-use landfill gas projects.Waste Management integrates the commerce application into the existing e-business project. Commerce application is a combination of different Products that are available from Waste management like Dumpster,Lamptracker, SMB,Medical Waste .Commerce Application is developed based on commerce using Broad leaf Commerce API ,customers can easily buy the products as well as request for a service and make the payment on-line using credit card. Waste management Lamp Tracker, which collects and recycles universal waste lamps, mercury containing equipment and batteries, This will have the discount option for the customers. Dumpster is a container were people can used to place the waste for residential customers. SMB is also a part of Dumpster only for Business people.',' Team Member',' To analyze, work and resolve support tickets assigned to eBusiness. Write DML scripts for updating the product prices and its relevant environment. To monitor the production environment and automated jobs running everyday for payment and ordered related records submitted to MAS. To analyze, work and resolve issue reported on ezpayID. To run weekly report every Monday for status on Waste Management Lamptracker, which is reporting data, presented to the client. To monitor payment transaction on HP BSM(Business Service Management). ',' Eclipse, HTML, JSP, SQL Server ,MS-Office,Libre office, XML,IBM Websphere server.',NULL,NULL,'2016-01-22 14:01:07','2016-01-22 14:01:07'),(37,2060,' Intelligrated - 7 Eleven implementation',' Inteligrated',' Nov-Dec 2014','Intelligrated is a leading North American-based, single-source provider of intelligent automated material handling solutions that drive distribution and fulfillment productivity for retailers, manufacturers and logistics providers around the world. Through a broad portfolio of automation equipment, software, service and support, Intelligrated solutions optimize processes, increase efficiency and give businesses a competitive edge.Knighted, an Intelligrated Company, is a leading single-source providerof fulfillment execution systems, with a comprehensive suite of warehouse management (WMS), warehouse control (WCS), order fulfillment, labor management and supply chain business intelligence software.Intelligrated helps retailers, manufacturers and logistics providers build smarter distribution and fulfillment operations, using the right mix of automation, software and labor. Reliable, high-performance solutions from Intelligrated utilize innovative concepts, industry-leading automation equipment and advanced controls and software to optimize productivity. Automation that delivers means providing best-fit solutions backed by total lifecycle support, reliable project execution and a company-wide commitment to deliver on promises.',' Team Member',' UI fixes Small enhancements Facilitate problem solving and collaboration Creation of Builds',' Eclipse, HTML, JSP, SQL Server ,MS-Office,Libre office, XML',NULL,NULL,'2016-01-22 14:01:07','2016-01-22 14:01:07'),(38,2061,' Ebiz',' Waste Management(U.S.A)',' Feb 2015 -till present','Waste Management, Inc. is the leading provider of comprehensive waste and environmental services in North America. Headquartered in Houston, the company serves nearly 20 million municipal, commercial, industrial, and residential customers through a network of 367 collection operations, 355 transfer stations, 273 active landfill disposal sites, 16 waste-to-energy plants, 104 recycling plants, and 111 beneficial-use landfill gas projects.Waste Management integrates the commerce application into the existing e-business project. Commerce application is a combination of different Products that are available from Waste management like Dumpster,Lamptracker, SMB,Medical Waste .Commerce Application is developed based on commerce using Broad leaf Commerce API ,customers can easily buy the products as well as request for a service and make the payment on-line using credit card. Waste management Lamp Tracker, which collects and recycles universal waste lamps, mercury containing equipment and batteries, This will have the discount option for the customers. Dumpster is a container were people can used to place the was