SOA 11g Practitioner ','Professional Summary:\r\n	7.6 Years of total IT experience.\r\n	4.6 Years of IT experience in Fusion Middleware, enterprise Application that involves extensive development work in ORACLE SOA SUITE 11.1.1.7, 11.1.1.6, 11.1.1.3 and 10.1.3.3\r\n	Proven Expertise on Oracle fusion middleware products like BPEL, ESB, Mediators, OBRE, BAM, JDeveloper, Eclipse, OC4J and Web logic server. Oracle Service bus 11g, OAG 11g.\r\n	Worked on web based technologies like XML, WSDL, XSD, XQuery, XPath and XSLT, Jboss & Tomcat.\r\n	Preparing POC according to client requirements.\r\n	Excellent application Development Skills, Strong Debugging & Problem solving skills.\r\n	Good communication, collaboration & team building skills with proficiency in grasping new technical concepts.\r\n	Good interpersonal skills, result oriented, hard working with a quest and zeal to learn new technologies and undertake challenging tasks.\r\n	Expertise with BPEL process Orchestration and Enterprise Service Bus (ESB) for integrating enterprise applications, Databases, legacy applications, Flat Files and Portals.\r\n	Experienced with Full Project life cycle and well versed with AIM, SDLC and Agile methodologies.\r\n	Good knowledge on PL\\SQL, Java and Liferay.\r\n\r\nTechnical Skills: \r\nLanguages	BPEL, C, Java\r\nWeb Technologies	Webservices\r\nMarkup Languages	HTML, XML\r\nScripting languages	JavaScript, VBScript\r\nXML Technologies	XML, XSL, XSLT, XPATH, SOAP, WSDL, CSS\r\nRDBMS	Oracle 8i-10g \r\nPackages	MS-Office , MS-Visio 2003/2007/2010\r\nOperating Systems	Windows 2000-XP-7-8, Sun Solaris\r\nIDE	Jdeveloper, Eclipse\r\nDatabase Technologies	RDO, ADODB, OLEDB, ADO.Net\r\nWeb Servers	Weblogic\r\nVersioning Tools	Clear Case, SVN\r\nAdvanced Concepts	Webservices, JMS\r\nReporting Tools	SQL Server Reports, Crystal Reports, OBIEE\r\nOpen Sources	 Java Liferay 6.2\r\nThird Party S/W	HP Kintana, Microsoft testing tools, Informatica \r\n\r\nProfessional Experience:\r\n\r\nClient Name: Zebra\r\nDuration: 6 Months\r\nProject Name: Zebra TSO R1 Release\r\nRole: Developer\r\nProject Brief:			 \r\nRewriting the existing MSI TSO SOA code for Zebra TSO, in this we are going to release R0 and R1.\r\n\r\nResponsibilities:\r\n	Understanding the Requirements and Design Specifications.\r\n	Involved in development of end to end and testing end ? end mechanism.\r\n	Worked on fine tuning and all SOA components.\r\n	Used JDeveloper IDE for coding.\r\n	Interacting with Client and updating personal and team status.\r\n	Check-in and check-out of source code in to version control tools (CVS).\r\n\r\nEnvironment: Weblogic, Jdeveloper (IDE)\r\n\r\n\r\nClient Name: DATU\r\nDuration: 3 Months\r\nProject Name: DATU Health\r\nRole: Developer\r\nProject Brief:			 \r\nDatu Health?s goal is to be make healthcare readily available to providers, patients, payers, and care circles.\r\n\r\nResponsibilities:\r\n	Understanding the Requirements and Design Specifications.\r\n	Involving in developing of JavaLiferay using liferayStudio.\r\n	Interacting with Client and updating personal and team status.\r\n	Check-in and check-out of source code in to version control tools (SVN).\r\n\r\nEnvironment: Tomcat, Jboss & Eclipse Juno (IDE)\r\n\r\n\r\n\r\nClient Name: Motorola Solutions Inc.\r\nDuration: 4 Months\r\nProject Name: Treasury\r\nRole: Middleware developer\r\nProject Brief:			 \r\nCurrently Trilogy EBS R12 system is receiving Journal entries feed from FX system.\r\nAs part of Treasury project, Motorola Solutions has decided to replace the FX system with SaaS (\"cloud\") based application SunGard. Treasury program aims to design, develop and implement simple and efficient services. \r\nWith Treasury SaaS project implementation Journal entries data will now be received from SunGard to Trilogy EBS R12 via Fusion Middleware integration. MSI will pull GL files from SunGard and transfer to Trilogy EBS R12 via SFTP.\r\n\r\nResponsibilities:\r\n	Understanding the Requirements and Design Specifications.\r\n	Involved in the development one interface and testing end ? end mechanism.\r\n	Worked on fine tuning of DB adapters.\r\n	Used common error handling web service to handle common errors in different services.\r\n	Used Jdeveloper IDE for coding.\r\n	Interacting with Client and updating personal and team status.\r\n	Check-in and check-out of source code in to version control tools (ClearCase).\r\n	Code deployment using HP Kintana tool.\r\n\r\nEnvironment: SOA Suite 11g (BPEL, Mediator, File Adapter, Ftp Adapter, DB Adapter, Email Activity, Java Embedding, BMC Ticketing Service, External Webservices, SFTP, Metadata services) WinScp, jDeveloper, SQL Developer, Clear Case, Kintana.\r\n\r\n\r\n\r\nClient Name: Motorola Solutions Inc.\r\nDuration: 7 Months\r\nProject Name: OAG-OSB Project \r\nRole: Middleware developer\r\nProject Brief:			 \r\nOAG-OSB build is a migration project from Forum system. Providing security to the existing web services and newly on boarded web services available in the Motorola Solutions.\r\nProving authentications and authorization is the basic theme to implement in this migration.\r\n\r\nResponsibilities:\r\n	Understanding the Requirements and Design Specifications.\r\n	Involved in On boarding the web services and testing end ? end mechanism.\r\n	Implemented reporting mechanism for the overall dashboard view.\r\n	Reporting implemented using DB adapter configurations\r\n	Worked on fine tuning of DB adapters.\r\n	Developed common error handling web service to handle common errors in different services.\r\n	Used Eclipse IDE for coding.\r\n	Interacting with Client and updating personal and team status.\r\n	Check-in and check-out of source code in to version control tools (ClearCase).\r\n	Code deployment using HP Kintana tool.\r\n\r\nEnvironment: OAG, OSB, WebLogic Server, Eclipse Indigo (IDE), Clearcase, kintana.\r\n\r\n\r\n\r\nClient Name: Motorola Solutions Inc.\r\nDuration: 1 Year 6 Months\r\nProject Name: iMonit\r\nRole: Middleware developer & L3 Support\r\nProject Brief:\r\nMotorola Solutions has taken an initiative to create monitoring layer on all its integrations developed between internal Motorola systems and with B2B clients, the solution is called iMonit. The approach is to develop a generic monitoring framework having capabilities to take any new integration on-board with minimal effort. The framework provides several key performance indicators and monitors for real time monitoring of integrations. The data model of framework will be scalable enough to generate new on-demand analysis reports. The framework will be exposed via different methods so that any system can use it for integration monitoring purposes.\r\n\r\nResponsibilities:\r\nUnderstanding the Requirements and Design Specifications.\r\nInvolved in on boarding the integrations in all environments.\r\nCreating build plan documents for the production GO-Live.\r\nMonitoring the on boarded and existing integrations and taking the necessary actions if required.\r\nImplementing Alert mechanism by using Business Rules for all the integrations.\r\nUsed JDeveloper IDE for coding BPEL Process Models.\r\nInteracting with Client and updating personal and team status.\r\nCheck-in and check-out of source code in to version control tools (ClearCase).\r\nCode deployment using HP Kintana tool.\r\n\r\nEnvironment: SOA Suite 11g (BPEL, Mediator, File Adapter, Ftp Adapter, DB Adapter, Email Activity, Java Embedding, BMC Ticketing Service, External Webservices, SFTP, Metadata services) WinScp, jDeveloper, SQL Developer, Clear Case, Kintana, OBIEE.\r\n\r\n\r\n\r\n\r\n','Please fill the required fields','SUBMITTED','PENDING','2016-01-22 15:16:37','2016-01-22 15:31:00',NULL,'2016-01-22 00:00:00'),(2064,6014,'0 Years 10 Months','0 Years 10 Months','Middleware','','Being Self-motivated and inspire team members. \r\nGood learning skills and applicability of concepts.\r\nExperimenting and learning new technologies, methods.',NULL,'PENDING','PENDING',